import React, { Component } from 'react'
import styled from 'styled-components'

const Section = styled.section`
position: relative;
min-height: 40vh;
width: 80vw;
display: flex;
flex-direction: column;
margin: 0 auto;
justify-content: space-evenly;
`

export default class CreateUser extends Component {
  render () {
    return (
      <Section>
        <div>CreateUser</div>
      </Section>
    )
  }
}
